import React, { Component } from 'react';

class Buttons extends Component {

    render() {
        return (
            <div className="container">
                {
                    this.props.buttons.map((button, i) => {
                        return (
                            <button
                                key={i}
                                className="btn-p"
                                onClick={() => { this.props.handleClick(button) }}>
                                {button}
                            </button>
                        );
                    })
                }
            </div>
        );
    }
}

